import React from 'react';

function Enter() {
    return (
     <>
         <div className="enter_wrap">
            <input className="enter_id" placeholder="아이디를 입력하세요"/>
             <input className="enter_pw" placeholder="비밀번호를 입력하세요"/>
             <button className="enter_btn">로그인</button>
         </div>
     </>
    )
}
export default Enter;
